events.event:
BOX_MSG box_info;
if(1 == read_box_info_station_num($test_parm.station_num , &box_info))
{
    $test_parm.station_port = box_info.station_port;
    memcpy($test_parm.virtualnumber , box_info.virtualnumber , 4);
    memcpy($test_parm.type,&box_info.type,1);
    memcpy($test_parm.status,&box_info.status,1);

    memcpy($test_parm.user_id,box_info.user_id,USERID_LENGTH);
    memcpy($test_parm.user_phnum,box_info.user_phnum,USER_PHNUM_LENGTH);
    memcpy($test_parm.pass_word,box_info.pass_word,USER_PASSWORD_LENGTH);
    memcpy($test_parm.send_num,box_info.send_num,SEND_NUM_LENGTH);
    memcpy($test_parm.send_id,box_info.send_id,SENDID_LENGTH);
}
